import axios from 'axios';

const BASE_URL = 'http://localhost:5000/api';

export const getPrinters = async (filters) => {
    return await axios.get(`${BASE_URL}/printers`, {
        params: filters
    });
}

export const getPrinterById = async (id) => {
    return await axios.get(`${BASE_URL}/printers/${id}`);
}
